import React, { Component } from 'react';
import styles from './ItemModel.module.scss';

export class ItemModel extends Component {
  render() {
    return (
      <div className={styles.itemModel}>
        <img src={this.props.itemModel.img} />
        <h1>{this.props.itemModel.title}</h1>
        <h2>{this.props.itemModel.text}</h2>
        <h3>{this.props.itemModel.category} </h3>
        <h1>{this.props.itemModel.price}</h1>
      </div>
    );
  }
}

export default ItemModel;
